"use client"

import { useState } from "react"
import { HeroSection } from "./hero-section"
import { SearchSection } from "./search-section"
import { ResultsSection } from "./results-section"
import axios from "axios"

export type StockData = {
  best_confidence: number
  best_model: string
  best_price_pred: number
  best_rmse: number
  current_price: number
  prediction_plot: string // base64 encoded image
  ticker: string
}

export type CompanyStocks = {
  companySymbol: string
  companyName: string
  stocks: StockData[]
}

// Dummy data as fallback
const DUMMY_STOCK_DATA: StockData = {
  best_confidence: 87.5,
  best_model: "LSTM Neural Network",
  best_price_pred: 185.42,
  best_rmse: 2.1456,
  current_price: 178.9,
  prediction_plot: "", 
  ticker: "AAPL",
}

export function StockPredictionApp() {
  const [selectedCompany, setSelectedCompany] = useState<CompanyStocks | null>(null)
  const [loading, setLoading] = useState(false)
  const [error, setError] = useState<string | null>(null)

  const handleSearch = async (symbol: string) => {
    setLoading(true)
    setError(null)

    try {
      // Try to fetch from backend
      const response = await axios.get(`http://localhost:5000/predict`, {
        params: {
          ticker: symbol,
        },
      })

      const stockData: StockData = response.data

      // Create a company structure with the single stock data
      const companyData: CompanyStocks = {
        companySymbol: stockData.ticker || symbol,
        companyName: getCompanyName(stockData.ticker || symbol),
        stocks: [stockData],
      }

      setSelectedCompany(companyData)
    } catch (err) {
      console.error("Error fetching stock data:", err)
      // Use dummy data as fallback
      /*
      const dummyData: StockData = {
        ...DUMMY_STOCK_DATA,
        ticker: symbol.toUpperCase(),
      }

      const companyData: CompanyStocks = {
        companySymbol: symbol.toUpperCase(),
        companyName: getCompanyName(symbol.toUpperCase()),
        stocks: [dummyData],
      }

      setSelectedCompany(companyData)
      */
      
      setError("Using demo data - backend unavailable")
    } finally {
    
      setLoading(false)
    }
  }

  // Helper function to get company name from ticker
  function getCompanyName(ticker: string): string {
    const companyNames: Record<string, string> = {
      AAPL: "Apple Inc.",
      GOOG: "Alphabet Inc.",
      GOOGL: "Alphabet Inc.",
      TSLA: "Tesla, Inc.",
      MSFT: "Microsoft Corporation",
      AMZN: "Amazon.com, Inc.",
      META: "Meta Platforms, Inc.",
      NFLX: "Netflix, Inc.",
      NVDA: "NVIDIA Corporation",
      JPM: "JPMorgan Chase & Co.",
      V: "Visa Inc.",
      WMT: "Walmart Inc.",
      DIS: "The Walt Disney Company",
      HDB: "HDFC Bank Limited",
      // Add more mappings as needed
    }

    return companyNames[ticker] || `${ticker} Corporation`
  }

  return (
    <main className="flex min-h-screen flex-col items-center">
      <HeroSection />
      <SearchSection onSearch={handleSearch} loading={loading} />
      <ResultsSection companyStocks={selectedCompany} loading={loading} error={error} />
    </main>
  )
}
